import React from 'react';

const CloseButton = () => (
<svg width="20px" height="20px" viewBox="0 0 20 20">
    <g id="04-Mobile-Applications" stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
        <g id="Reliant-Product-Catalog---Mobile-3" transform="translate(-313.000000, -78.000000)" fill="#005EFF">
            <g id="Group-4" transform="translate(323.000000, 88.000000) rotate(-360.000000) translate(-323.000000, -88.000000) translate(313.000000, 78.000000)">
                <polygon id="Rectangle" transform="translate(10.000000, 10.000000) rotate(45.000000) translate(-10.000000, -10.000000) " points="-2 8 22 8 22 12 -2 12"></polygon>
                <polygon id="Rectangle" transform="translate(10.000000, 10.000000) scale(-1, 1) rotate(45.000000) translate(-10.000000, -10.000000) " points="-2 8 22 8 22 12 -2 12"></polygon>
            </g>
        </g>
    </g>
</svg>
);

export default CloseButton;
